package com.misit.abpenergy.Main.Responseimport androidx.annotation.Keepimport com.google.gson.annotations.SerializedName@Keepdata class MessageInfoResponse(	@field:SerializedName("message_info")	var messageInfo: List<MessageInfoItem>? = null)@Keepdata class MessageInfoItem(	@field:SerializedName("pesan")	var pesan: String? = null,	@field:SerializedName("tgl")	var tgl: String? = null,	@field:SerializedName("judul")	var judul: String? = null,	@field:SerializedName("id_info")	var idInfo: Int? = null,	@field:SerializedName("status")	var status: Int? = null)